async function getModFile(subject, gameid, ApiKeylabel) {
  try {
    
    const response = await fetch('https://g-' + gameid + '.modapi.io/v1/games/' + gameid + '/mods/' + subject + '/files?api_key=' + ApiKeylabel);
    
   
    if (!response.ok) {
      throw new Error('Mod.io Server response was not ok, (did you use the right Game ID and API key and or Mod ID?) ' + response.statusText);
    }

    
    const data = await response.json();
    
   
    const modFile = data.data[0]; 
    const binaryUrl = modFile.download.binary_url;
    const fileHash = modFile.filehash.md5; 

    // console.log('Binary URL:', binaryUrl);
    // console.log('File Hash (MD5):', fileHash);

    const downloadResponse = await fetch(binaryUrl);

    if (!downloadResponse.ok) {
      return 'Failed to fetch the mod file: ' + downloadResponse.statusText
    }

    const blob = await downloadResponse.blob();

    console.log('Downloaded Blob:', blob);

    const base64File = await convertBlobToBase64(blob);

    // console.log('Base64 Encoded File:', base64File);

    return base64File;
  } catch (error) {
    return error;
  }
}

function convertBlobToBase64(blob) {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    
    reader.onloadend = () => {
      
      const base64Data = reader.result;
      
      if (base64Data && base64Data.includes('base64,')) {
        resolve(base64Data);  
      } else {
        reject(new Error('Invalid data URL'));
      }
    };

    reader.onerror = (err) => {
      reject(new Error('Error reading Blob as Base64: ' + err));
    };

    reader.readAsDataURL(blob);
  });
}



Scratch.extensions.register(new modio());
